import pineappleImage from "../../img/ananas.jpg";
import { render } from "@testing-library/react";
class Dashboard extends React.Component {
    constructor(props){
        super(props);
        this.state = {productCards: []};
    }
    componentDidmount(){
        let productCards = [
            {
                name: "Placeholder"
            },
            {
                name: "Flowers",
                img: flowerImage
            },
            {
                name: "Ananas",
                img: pineappleImage
            }
        ];
        this.setState({productCards: productCards})

    }


    render(){
        return(
            <article className="dashboard">
                <Leftpane navigationListItems={navigationListItems}>buttonText = "Go Premium"</Leftpane>
                <RightPane productCards={this.state.productCards} headerText="Mijn Producten" buttonSymbol="+" buttonText="Voeg een Product toe"></RightPane>
                <div></div>
            </article>
        );
    }

}

export default Dashboard;
